(5, 10, 'modrožlutá skleněná váza', 180, 'Je to skleněná váza vyrobená ve sklárně Janov nad Nisou. Váza je velmi hezká a nepoškozená. Výška vázy je 27 cm, průměr je 15,2 cm.', 112, '03.jpg', NULL, NULL, NULL, NULL, NULL),
(6, 10, 'modrovínová skleněná váza', 170, 'Je to skleněná modrovínová váza, která byla vyrobena ve sklárně Janov nad Nisou. Je to velmi hezká ruční práce. výška vázy je 31 cm. Průměr 13 cm.', 112, '05.jpg', NULL, NULL, NULL, NULL, NULL),
(7, 10, 'skleněná karafa', 50, 'skleněná karafa se zabroušenou skleněnou zátkou. Karafa je opatřena hezkým zlatým dekorem. 20 x 10 x 7 cm', 112, '07.jpg', NULL, NULL, NULL, NULL, NULL),
(8, 10, 'skleněý zelený košík', 120, 'Skleněný zelený košík. Velmi hezký ručně vyrobený skleněný košík ve sklárně Janov nad Nisou. Jemná horní prasklina. 20 x 16 x 17 cm.', 112, '09.jpg', NULL, NULL, NULL, NULL, NULL),
(9, 10, 'žlutá váza', 120, 'skleněná žlutá váza vyrobená ručně ve sklárně Janov nad Nisou. Drobné vnitřní nečistoty. Výška 28 cm. Průměr 16 cm.', 112, '11.jpg', NULL, NULL, NULL, NULL, NULL),
(10, 10, 'Květinová dekorace', 30, 'Hezká květinová dekorace vytvořena ze suchých květin. Výška 30 cm. Průměr 20 cm.', 48, '013.jpg', NULL, NULL, NULL, NULL, NULL),
(11, 10, 'čokoládovar', 100, 'Pouze jednou použitý čokoládovar.', 39, '001.jpg', NULL, NULL, NULL, NULL, NULL),
(13, 10, 'menší proutěný koš pro dárkové balení', 30, 'Perfektní nový proutěný koš pro dárkové balení. 48 x 38 x 14 cm', 46, '005.jpg', NULL, NULL, NULL, NULL, NULL),
(14, 10, 'větší proutěný koš pro dárkové balení', 50, 'větší proutěný koš pro dárkové balení. 50 x 46 x 22 cm', 46, '007.jpg', NULL, NULL, NULL, NULL, NULL),
(15, 10, 'Velké balení trávníkového hnojiva na 200 m2', 50, 'Velké balení trávníkového hnojiva určeného pro 200 m2 trávníku. 5 kg', 48, '009.jpg', NULL, NULL, NULL, NULL, NULL),
(16, 10, 'elektrický gril se stojanem', 250, 'skoro nepoužívaný elektrický gril se stojanem (stojan je ještě originálně zabalen). 55 x 34 x 10 cm (bez stojanu)', 39, '0001.jpg', NULL, NULL, NULL, NULL, NULL),
(17, 10, 'elektrická masážní koupel nohou', 200, 'Výborný stav ! Skoro nepoužívaná. 42 x 37 x 19 cm', 37, '0003.jpg', NULL, NULL, NULL, NULL, NULL),
(18, 10, 'elektrická teflonová pečenka', 200, 'Prakticky nepoužitá elektrická teflonová pečenka. 40 x 27 x 20 cm', 39, '0005.jpg', NULL, NULL, NULL, NULL, NULL),
(19, 10, 'kytara i s pouzdrem', 350, 'Jedna prasklá struna jinak je naprosto vpořádku.', 56, '000007.jpg', NULL, NULL, NULL, NULL, NULL),
(20, 10, 'elektrický šicí stroj', 450, 'Funkční skoro nepoužívaný elektrický šicí stroj. 40 x 15 x 30 cm', 39, '0009.jpg', NULL, NULL, NULL, NULL, NULL);
